import React, { useState } from 'react';

const LoginPage = () => {
  // State for email and password input values
  const [email, setEmail] = useState('student@ucsb.edu');
  const [password, setPassword] = useState('Password');

  // Function to handle login submission
  const handleLogin = () => {
    // Add your login logic here
    console.log('Login button clicked');
  };

  return (
    <div className="login-container">
      <div className="left-section">
        {/* Logo */}
        <img src="path/to/your/logo.png" alt="Logo" className="logo" />

        {/* Welcome back text */}
        <div className="welcome-text">Welcome back!</div>

        {/* Vertical line */}
        <div className="vertical-line"></div>

        {/* Email and Password inputs */}
        <div className="input-section">
          <label>Email address</label>
          <input
            type="text"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <label>Password</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />

          {/* Login button */}
          <button onClick={handleLogin}>Let's go!</button>
        </div>
      </div>

      <div className="right-section">
        {/* Continue with Google button */}
        <button className="social-button">Continue with Google</button>

        {/* Continue with Apple button */}
        <button className="social-button">Continue with Apple</button>

        {/* Don't have an account text and Sign Up button */}
        <div className="signup-section">
          <label>Don't have an account?</label>
          <button className="signup-button">Sign up</button>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
